import { Menu } from 'antd';
import { FacebookOutlined, InstagramOutlined, GithubOutlined } from '@ant-design/icons';

const { SubMenu } = Menu;

class Footer extends React.Component {
  state = {
    current: 'footer',
  };

  handleClick = e => {
    console.log('click ', e);
    this.setState({ current: e.key });
  };

  render() {
    const { current } = this.state;
    return (
      <Menu onClick={this.handleClick} selectedKeys={[current]} mode="horizontal" theme='dark' style={{ backgroundColor: '#5C082A', display:'flex', justifyContent:'space-evenly'}}>
        <Menu.Item key="aboutus"  style={{ backgroundColor: '#5C082A'}}>
