        </Menu.Item>
        <Menu.Item key="facebook" icon={<GithubOutlined />} style={{ backgroundColor: '#5C082A'}}>
          <a href="https://github.com" target="_blank" rel="noopener noreferrer"></a>
        </Menu.Item>
      </Menu>
    );
  }
}

